import '../css/home.css' ;
import Navbar from '../component/navbar';
import { Fragment } from 'react';
import BoxVdo1 from '../component/com-home/ContentBoxVdo1';
import ContenBox1 from '../component/com-home/ContentBox1';
import Scolltotop from '../component/com-home/ScollToTop';
import Footers from '../component/com-home/footer';
import Formlogin from '../component/com-singin/formlogin';

function home() {
    return (
        <div>
            <Navbar></Navbar>
            <body>
            <div class="landingpage">
                <ContenBox1></ContenBox1>
                <section class="vdo" >
                <iframe id="Vdo1" width="560" height="315" src="https://www.youtube.com/embed/UVzVUDXoi0Y" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
                </section>
                <Fragment>
                    <Scolltotop></Scolltotop>
                </Fragment>
            </div>
            <section>
                <Footers></Footers>
            </section>




        </body>
        </div>
    );
  }

  export default home;
